import './Movie.css';

const Movie = (props) => {
    return (
                <div className="card card-movie" onMouseOver={props.changeBg.bind(this, (props.movieId))}>
                    <div className="card-image">
                        <img src={ props.poster } alt=''/>
                    </div>
                    <div className="card-content">
                        <span className="card-title">{ props.title }</span>
                    </div>
                    <div className="card-action">
                        <a 
                            href='!#' 
                            className="btn-movie"
                        >more</a>
                    </div>
                </div>
    )
}

export { Movie }
